function drawN()
{
	var pos = random(0,list.length); 
	setResult(list['users'][pos]);
	if (stopping && --countdown==0)
	{
		getResult(pos);
	}
}

function setResult(res)
{
	if (current != null) {
		content="<div class='line "+(stopping?'even':'odd')+"'>"+res['name']+"("+res['studentid']+")"+"</div>"; 
		potentialHistory="<div class='line "+(stopping?'even':'odd')+"'>["+prize.value+"]"+res['name']+"("+res['studentid']+")"+"</div>"; 
		current.innerHTML=content;
	}
}

function getResult(pos)
{
	clearInterval(I);
	list['users'][pos]=null;
	picking=false;
	stopping=false;
	drawBtn.innerHTML="Start";
	history.innerHTML=potentialHistory+history.innerHTML;
	drawed=true;
}

function Lottery(n) {
	cleared=false;
	if (stopping)
	{
		return;
	}
	if (picking)
	{
		if (cleared) 
			return;
		stopping=true;
		countdown=20;
		return;
	}
	else
	{
		picking=true;
		drawBtn.innerHTML="Stop";
	}
	I=setInterval(function(){drawN(n)},60);
}

function random(start,end)
{
	var pos=-1;
	while (list['users'][pos]==null)
	{
		pos=Math.floor(start+Math.random()*end);
	}

	return pos;
}